INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ", 0, 27, 8, "トゥインクルウィッシュ", 2, "人助け、応援", "人助けが大好き！　前向き格闘娘", "東山奈央", 155, 100101, 16, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ", 0, 5, 4, "トゥインクルウィッシュ", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 158, 100201, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ", 0, 12, 1, "トゥインクルウィッシュ", 2, "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", "早見沙織", 163, 100301, 18, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ミソギ", 0, 10, 8, "リトルリリカル", 5, "いたずら、探検", "探検好きのイタズラっ子", "諸星すみれ", 128, 100401, 9, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 40, "？？？", "マツリ", 0, 25, 11, "王宮騎士団（NIGHTMARE）", 8, "ヒーローごっこ", "ヒーローに憧れる騎士見習いの少女", "下田麻美", 146, 100501, 12, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "アカリ", 0, 22, 11, "悪魔偽王国軍（ディアボロス）", 7, "サックス", "甘え上手なみんなの人気者", "浅倉杏美", 150, 100601, 13, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ", 0, 23, 1, "悪魔偽王国軍（ディアボロス）", 7, "プリンを食べること", "プリン大好きゴースト娘", "雨宮天", 130, 100701, 14, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ", 0, 10, 10, "ヴァイスフリューゲル　ランドソル支部", 15, "鏡で自分を見ること", "ボクは誰よりも美しい", "大空直美", 150, 100801, 14, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "アンナ", 0, 5, 7, "トワイライトキャラバン", 13, "小説執筆", "前世を信じる中二病患者、「疾風の冥姫」", "髙野麻美", 159, 100901, 17, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホ", 0, 22, 9, "自警団（カォン）", 10, "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", "内田真礼", 155, 101001, 16, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "リノ", 0, 25, 8, "ラビリンス", 3, "お裁縫", "人懐っこくてマシンガントークな妹系少女", "阿澄佳奈", 156, 101101, 15, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "ハツネ", 0, 24, 12, "フォレスティエ", 6, "妹と遊ぶこと、二度寝、昼寝、早寝", "みんなのために超能力を使う眠り姫", "大橋彩香", 156, 101201, 17, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 55, "", "ナナカ", 0, 21, 8, "トワイライトキャラバン", 13, "読書、魔法", "オタク全開な魔法少女", "佳村はるか", 166, 101301, 18, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 41, "test", "カスミ", 0, 3, 11, "自警団（カォン）", 10, "読書、推理", "頭脳明晰な美少女名探偵", "水瀬いのり", 152, 101401, 15, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 54, "test", "ミサト", 0, 5, 9, "フォレスティエ", 6, "絵本作り", "母性溢れる優しいみんなの「ミサト先生」", "國府田マリ子", 165, 101501, 21, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "スズナ", 0, 10, 4, "ルーセント学院", 14, "ファッション", "天真爛漫で人気者のカリスマモデル", "上坂すみれ", 167, 101601, 18, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "カオリ", 0, 7, 7, "自警団（カォン）", 10, "踊り、空手", "いつでも「なんくるないさ～」な天然娘", "高森奈津美", 158, 101701, 19, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 52, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "イオ", 0, 14, 8, "ルーセント学院", 14, "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "多くの男性を魅了する無垢な女教師", "伊藤静", 162, 101801, 23, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "ミミ", 0, 3, 4, "リトルリリカル", 5, "かわいいもの集め", "お歌もにんじんも、ウサギさんも大好き♪", "日高里菜", 117, 102001, 10, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ", 0, 9, 6, "サレンディア救護院", 9, "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 150, 102101, 12, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ヨリ", 0, 22, 11, "悪魔偽王国軍（ディアボロス）", 7, "ゲーム全般", "人見知りであまのじゃくな女の子", "原紗友里", 150, 102201, 13, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ", 0, 10, 5, "サレンディア救護院", 9, "屋内でできる遊び", "ぷうきちといつも一緒！", "芹澤優", 148, 102301, 14, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ", 0, 12, 12, "サレンディア救護院", 9, "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", 154, 102501, 15, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 42, "test", "リン", 0, 1, 1, "牧場（エリザベスパーク）", 11, "あんパン", "遊びと睡眠が何より大事なぐうたら娘", "小岩井ことり", 144, 102601, 17, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ", 0, 30, 7, "トワイライトキャラバン", 13, "実験、裁縫、料理", "運命の相手に一途すぎる乙女", "橋本ちなみ", 154, 102701, 16, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレン", 0, 4, 10, "サレンディア救護院", 9, "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", "堀江由衣", 156, 102801, 17, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 40, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ノゾミ", 0, 24, 1, "カルミナ", 4, "舞台鑑賞、ダンス", "歌って踊れる大人気アイドル", "日笠陽子", 157, 102901, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン", 0, 31, 8, "ヴァイスフリューゲル　ランドソル支部", 15, "忍法開発", "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 163, 103001, 16, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ", 0, 22, 12, "悪魔偽王国軍（ディアボロス）", 7, "占い", "占いが得意な霊能少女", "大坪由佳", 157, 103101, 18, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "アキノ", 0, 12, 3, "メルクリウス財団", 12, "慈善事業", "一人前の商人を目指すパワフルお嬢様", "松嵜麗", 157, 103201, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "マヒル", 0, 3, 3, "牧場（エリザベスパーク）", 11, "漫才", "みんなを笑顔にするお笑い牧場主", "新田恵海", 142, 103301, 20, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 55, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ユカリ", 0, 16, 3, "メルクリウス財団", 12, "ウインドーショッピング", "純情でほっとけない大人の女性", "今井麻美", 164, 103401, 22, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 21, "test", "キョウカ", 0, 2, 2, "リトルリリカル", 5, "お勉強", "礼儀正しくしっかり者のちびっ子優等生", "小倉唯", 118, 103601, 8, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 43, "test", "トモ", 0, 11, 8, "王宮騎士団（NIGHTMARE）", 8, "剣術、年長者をからかう", "義理堅くてからかい好きな剣術少女", "茅原実里", 149, 103701, 13, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 40, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "シオリ", 0, 3, 11, "牧場（エリザベスパーク）", 11, "読書、お散歩", "読書が趣味の病弱少女", "小清水亜美", 153, 103801, 14, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 44, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "アオイ", 0, 6, 6, "フォレスティエ", 6, "友達作りのイメトレ", "「友達」に憧れる、エルフの森の女の子", "花澤香菜", 158, 104001, 13, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ", 0, 3, 6, "カルミナ", 4, "各種楽器", "人々を守るために歌う、唱喚士の少女", "福原綾香", 163, 104201, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "マコト", 0, 9, 8, "自警団（カォン）", 10, "お菓子作り", "男勝りで情に厚いワイルド娘", "小松未可子", 168, 104301, 17, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 50, "test", "イリヤ", 0, 5, 5, "悪魔偽王国軍（ディアボロス）", 7, "世界征服", "かつては夜を支配した最強の吸血鬼", "丹下桜", 172, 104401, "??", "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "クウカ", 0, 19, 11, "ヴァイスフリューゲル　ランドソル支部", 15, "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", 157, 104501, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ", 0, 1, 3, "メルクリウス財団", 12, "猫とたわむれること", "弱きを助け強きをくじく猫娘", "沼倉愛美", 158, 104601, 18, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 50, "？？？", "ジュン", 0, 25, 10, "王宮騎士団（NIGHTMARE）", 8, "格闘技、湯浴み", "素顔を見せない冷静沈着な女性騎士", "川澄綾子", 171, 104701, 25, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ", 0, 11, 11, "メルクリウス財団", 12, "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 163, 104801, 20, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル", 0, 24, 10, "ラビリンス", 3, "家事全般", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 168, 104901, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ", 0, 3, 1, "ルーセント学院", 14, "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", "久野美咲", 120, 105001, 11, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 53, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ミツキ", 0, 7, 3, "トワイライトキャラバン", 13, "研究、実験", "実験が趣味の危険な科学者", "三石琴乃", 166, 105101, 27, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 100, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "リマ", 0, 14, 3, "牧場（エリザベスパーク）", 11, "毛繕い、お喋り", "乙女チックなもふもふアニマル", "徳井青空", 150, 105201, 18, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 33, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "モニカ", 0, 28, 7, "ヴァイスフリューゲル　ランドソル支部", 15, "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", "辻あゆみ", 140, 105301, 18, "ヒューマン");
