INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 43, "test", "アユミ", 0, 7, 4, "ヴァイスフリューゲル　ランドソル支部", 15, "観察", "どこまでも一途に慕う、純情乙女", "大関英里", 155, 105501, 16, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 54, "test", "ルカ", 0, 11, 7, "トワイライトキャラバン", 13, "釣り", "人情味溢れる粋でいなせな「姉御」", "佐藤利奈", 167, 105601, 25, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 45, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "ジータ", 0, 10, 3, "？？？", "", "冒険、おしゃべり", "空への冒険を夢見る騎空士の少女", "金元寿子", 156, 105701, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 46, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", "ペコリーヌ", 0, 31, 3, "美食殿", 1, "食べ歩き、料理", "いつも元気な腹ペコ少女", "M・A・O", 156, 105801, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 35, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", "コッコロ", 0, 11, 5, "美食殿", 1, "瞑想、動植物の飼育", "主を慕う、小さなガイド役", "伊藤美来", 140, 105901, 11, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 39, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", "キャル", 0, 2, 9, "美食殿", 1, "猫と遊ぶ", "行き倒れの謎のネコミミ魔法使い", "立花理香", 152, 106001, 14, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 40, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", "ムイミ", 0, 11, 8, "？？？", "", "冒険、思い出話", "さまよえる謎の少女", "潘めぐみ", 148, 106101, 16, "ヒューマン");
