INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "??", "", "ネネカ", 0, 24, 3, "？？？", "", "物真似、芸術鑑賞", "研究所に隠れ住む物静かなお姉さん", "井口裕香", 149, 107001, 24, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "??", "", "クリスティーナ", 0, 7, 2, "王宮騎士団（NIGHTMARE）", 8, "強敵との闘争", "傍若無人な王宮騎士団副団長", "たかはし智秋", 165, 107101, 27, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 46, "あ、あの…何か食べ物持っていませんか？\nもう、お腹ペコペコで…", "ペコリーヌ（サマー）", 0, 31, 3, "美食殿", 1, "食べ歩き、料理", "いつも元気な腹ペコ少女", "M・A・O", 156, 107501, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 35, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", "コッコロ（サマー）", 0, 11, 5, "美食殿", 1, "瞑想、動植物の飼育", "主を慕う、小さなガイド役", "伊藤美来", 140, 107601, 11, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ（サマー）", 0, 12, 12, "サレンディア救護院", 9, "ご奉仕", "お嬢さまのためにがんばるドジっ娘メイド", "悠木碧", 154, 107701, 15, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 39, "なに、モタモタしてんのよ\n仕方ないから、あたしが手伝ってあげるわ\nいい？　感謝しなさいよね！", "キャル（サマー）", 0, 2, 9, "美食殿", 1, "猫と遊ぶ", "行き倒れの謎のネコミミ魔法使い", "立花理香", 152, 107801, 14, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ（サマー）", 0, 1, 3, "メルクリウス財団", 12, "猫とたわむれること", "弱きを助け強きをくじく猫娘", "沼倉愛美", 158, 107901, 18, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ（サマー）", 0, 11, 11, "メルクリウス財団", 12, "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 163, 108001, 20, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ（ハロウィン）", 0, 22, 12, "悪魔偽王国軍（ディアボロス）", 7, "占い", "占いが得意な霊能少女", "大坪由佳", 157, 108101, 18, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ（ハロウィン）", 0, 23, 1, "悪魔偽王国軍（ディアボロス）", 7, "プリンを食べること", "プリン大好きゴースト娘", "雨宮天", 130, 108201, 14, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 22, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ミサキ（ハロウィン）", 0, 3, 1, "ルーセント学院", 14, "ファッション誌鑑賞、コスメ集め", "ちょっとおませな恋に恋する女の子", "久野美咲", 120, 108301, 11, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（クリスマス）", 0, 3, 6, "カルミナ", 4, "各種楽器", "人々を守るために歌う、唱喚士の少女", "福原綾香", 163, 108401, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ（クリスマス）", 0, 9, 6, "サレンディア救護院", 9, "観劇、おままごと", "泣き虫で臆病な守ってあげたい女の子", "植田佳奈", 150, 108501, 12, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ（クリスマス）", 0, 10, 5, "サレンディア救護院", 9, "屋内でできる遊び", "ぷうきちといつも一緒！", "芹澤優", 148, 108601, 14, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（ニューイヤー）", 0, 27, 8, "トゥインクルウィッシュ", 2, "人助け、応援", "人助けが大好き！　前向き格闘娘", "東山奈央", 155, 108701, 16, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（ニューイヤー）", 0, 5, 4, "トゥインクルウィッシュ", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 158, 108801, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（ニューイヤー）", 0, 12, 1, "トゥインクルウィッシュ", 2, "読書、乗馬、お茶", "クールで何事にも真っ直ぐな剣士", "早見沙織", 163, 108901, 18, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（バレンタイン）", 0, 30, 7, "トワイライトキャラバン", 13, "実験、裁縫、料理", "運命の相手に一途すぎる乙女", "橋本ちなみ", 154, 109001, 16, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル（バレンタイン）", 0, 24, 10, "ラビリンス", 3, "家事全般", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 168, 109101, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 55, "私はアン！一応、マナリア王国の\n第一王女だけど…あまりかしこまらないで、\n気軽に仲良くしてくれたら嬉しいな！", "アン", 0, 1, 12, "？？？", "", "読書", "英霊と契約を結んだマナリアの天才王女", "日笠陽子", 156, 109201, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 45, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "ルゥ", 0, 4, 2, "？？？", "", "食べること、眠ること", "マナリア魔法学院の新入生", "こやまきみこ", 144, 109301, 15, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 67, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "グレア", 0, 3, 11, "？？？", "", "ピアノ", "人を超越した力を有す心優しい竜姫", "福原綾香", 167, 109401, 17, "半人半竜");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 49, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "クウカ（オーエド）", 0, 19, 11, "ヴァイスフリューゲル　ランドソル支部", 15, "小説を読むこと", "妄想大好き！　ほんとは照れ屋な女の子", "長妻樹里", 157, 109501, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン（オーエド）", 0, 31, 8, "ヴァイスフリューゲル　ランドソル支部", 15, "忍法開発", "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 163, 109601, 16, "ヒューマン");
