INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 33, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "モニカ（マジカル）", 0, 28, 7, "ヴァイスフリューゲル　ランドソル支部", 15, "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", "辻あゆみ", 140, 114201, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 43, "", "トモ（マジカル）", 0, 11, 8, "王宮騎士団（NIGHTMARE）", 8, "剣術、年長者をからかう", "義理堅くてからかい好きな剣術少女", "茅原実里", 149, 114301, 13, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "アキノ（クリスマス）", 0, 12, 3, "メルクリウス財団", 12, "慈善事業", "一人前の商人を目指すパワフルお嬢様", "松嵜麗", 157, 114401, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレン（クリスマス）", 0, 4, 10, "サレンディア救護院", 9, "経営、お茶会", "救護院を経営する優しい庶民派お嬢様", "堀江由衣", 156, 114501, 17, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 55, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "ユカリ（クリスマス）", 0, 16, 3, "メルクリウス財団", 12, "ウインドーショッピング", "純情でほっとけない大人の女性", "今井麻美", 164, 114601, 22, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 40, "いいんだ、アタシは……独りでも。大丈夫だから、もう慣れたからさぁ", "ムイミ（ニューイヤー）", 0, 11, 8, "？？？", "", "冒険、思い出話", "さまよえる謎の少女", "潘めぐみ", 148, 114701, 16, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", "??", "", "ネネカ（ニューイヤー）", 0, 24, 3, "？？？", "", "物真似、芸術鑑賞", "研究所に隠れ住む物静かなお姉さん", "井口裕香", 149, 115001, 24, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 35, "主さまのガイド役を仰せつかりました\nわたくし、主さまに満足していただけるよう\n誠心誠意尽くさせていただきます", "コッコロ（儀装束）", 0, 11, 5, "美食殿", 1, "瞑想、動植物の飼育", "主を慕う、小さなガイド役", "伊藤美来", 140, 115501, 11, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（儀装束）", 0, 5, 4, "トゥインクルウィッシュ", 2, "料理、人間観察", "戦闘のサポートが得意な、心優しい少女", "種田梨沙", 158, 115601, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 41, "", "カスミ（サマー）", 0, 3, 11, "自警団（カォン）", 10, "読書、推理", "頭脳明晰な美少女名探偵", "水瀬いのり", 152, 115701, 15, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 100, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "リマ（シンデレラ）", 0, 14, 3, "牧場（エリザベスパーク）", 11, "毛繕い、お喋り", "乙女チックなもふもふアニマル", "徳井青空", 150, 115801, 18, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "マコト（シンデレラ）", 0, 9, 8, "自警団（カォン）", 10, "お菓子作り", "男勝りで情に厚いワイルド娘", "小松未可子", 168, 115901, 17, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホ（シンデレラ）", 0, 22, 9, "自警団（カォン）", 10, "空想、ぬいぐるみ集め", "マホマホ王国のプリンセス", "内田真礼", 155, 116001, 16, "獣人族");
