INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 48, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "タマキ（作業服）", 0, 1, 3, "メルクリウス財団", 12, "猫とたわむれること", "弱きを助け強きをくじく猫娘", "沼倉愛美", 158, 116801, 18, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 49, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "ミフユ（作業服）", 0, 11, 11, "メルクリウス財団", 12, "傭兵などのアルバイト", "仕事も私事も効率優先な傭兵少女", "田所あずさ", 163, 116901, 20, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（サマー）", 0, 30, 7, "トワイライトキャラバン", 13, "実験、裁縫、料理", "運命の相手に一途すぎる乙女", "橋本ちなみ", 154, 117001, 16, "魔族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 54, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "シズル（サマー）", 0, 24, 10, "ラビリンス", 3, "家事全般", "お姉ちゃんがお世話してあげるからねっ！", "生天目仁美", 168, 117101, 18, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("B", 40, "", "ノゾミ（サマー）", 0, 24, 1, "カルミナ", 4, "舞台鑑賞、ダンス", "歌って踊れる大人気アイドル", "日笠陽子", 157, 117201, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（サマー）", 0, 3, 6, "カルミナ", 4, "各種楽器", "人々を守るために歌う、唱喚士の少女", "福原綾香", 163, 117301, 17, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 45, "", "ツムギ（サマー）", 0, 7, 9, "カルミナ", 4, "裁縫", "ファッション大好きなキュートガール", "木戸衣吹", 153, 117401, 14, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 53, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "ミツキ（オーエド）", 0, 7, 3, "トワイライトキャラバン", 13, "研究、実験", "実験が趣味の危険な科学者", "三石琴乃", 166, 117501, 27, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("AB", 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ（オーエド）", 0, 10, 10, "ヴァイスフリューゲル　ランドソル支部", 15, "鏡で自分を見ること", "ボクは誰よりも美しい", "大空直美", 150, 117601, 14, "エルフ");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "カオリ（ハロウィン）", 0, 7, 7, "自警団（カォン）", 10, "踊り、空手", "いつでも「なんくるないさ～」な天然娘", "高森奈津美", 158, 117701, 19, "獣人族");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 51, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ニノン（ハロウィン）", 0, 31, 8, "ヴァイスフリューゲル　ランドソル支部", 15, "忍法開発", "トーゴクの神秘、オシエテクダサイ！", "佐藤聡美", 163, 117801, 16, "ヒューマン");
INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("O", 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "スズナ（ハロウィン）", 0, 10, 4, "ルーセント学院", 14, "ファッション", "天真爛漫で人気者のカリスマモデル", "上坂すみれ", 167, 117901, 18, "魔族");
