INSERT INTO `v1_fd759aa0d7c2d1ad564e2580e46b5f9b69e05df3d03a33dc1faab92b4e6a09c4` VALUES ("A", 33, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "モニカ（カフェ）", 0, 28, 7, "ヴァイスフリューゲル　ランドソル支部", 15, "お菓子屋通い", "見た目も中身もお子ちゃまな異国の軍人", "辻あゆみ", 140, 125201, 18, "ヒューマン");
